(1, 'All Products', 'products', NULL, NULL, '<p>Enhance your industrial operations with high-performance chemical solutions. Choose from a wide range of metal finishing, steel mill, plywood &amp; MDF, textile, leather, coating, organic, and pharmaceutical (API) chemicals designed for durability, efficiency, and sustainability.</p>', NULL, 'products', 'Pharmaceutical Chemicals | High-Quality API & Compounds', 'Explore GTZ India\'s pharmaceutical chemicals, including top-quality APIs & specialty compounds. Ensuring safety, efficacy, and compliance since 1936.', '<script type=\"application/ld+json\">\r\n	{\r\n	  \"@context\": \"https://schema.org/\",\r\n	  \"@type\": \"Organization\",\r\n	  \"url\": \"https://www.gtzworld.com/\",\r\n	  \"logo\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n	  \"name\": \"GTZ India Pvt. Ltd.\",\r\n	  \"image\": \"https://www.gtzworld.com/assets/frontend/img/slider1.jpg\",\r\n	  \"email\": \"connect@gtzworld.com\",\r\n	  \"description\": \"GTZ India Pvt Ltd offers a wide range of industrial chemicals, including metal finishing, steel mill, textile, leather, and API chemicals. Contact us for high-performance chemical solutions.\",\r\n	  \"address\": \"9, Brabourne Road, Kolkata 700 001, West Bengal, India\",\r\n	  \"telephone\": \"+91 33 2242 9900\",\r\n	  \"brand\": {\r\n		\"@type\": \"Organization\",\r\n		\"name\": \"GTZ India Pvt. Ltd.\",\r\n		\"logo\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n		\"url\": \"https://www.gtzworld.com/\",\r\n		\"sameAs\": \"\",\r\n		\"location\": \"Kolkata\",\r\n		\"identifier\": \"\"\r\n	  },\r\n	  \"aggregateRating\": {\r\n		\"@type\": \"AggregateRating\",\r\n		\"ratingValue\": \"4.9\",\r\n		\"ratingCount\": \"141900\"\r\n	  },\r\n	  \"areaServed\": \"World\",\r\n	  \"founder\": {\r\n		\"@type\": \"Person\",\r\n		\"name\": \"Arun Kumar Sawalka\",\r\n		\"image\": \"https://media.licdn.com/dms/image/v2/C4E03AQEFbc3HxdS5yA/profile-displayphoto-shrink_400_400/profile-dis