(2, 'About Us | GTZ India Pvt. Ltd.', 'about-us', NULL, NULL, '<h3 data-start=\"998\" data-end=\"1045\">Our Legacy of Innovation &amp; Excellence</h3>\r\n<p data-start=\"1046\" data-end=\"1377\">Founded in 1936 as part of the US-based trading house Getz Bros &amp; Co Inc, GTZ India Pvt Ltd has built a strong reputation in the specialty chemicals sector. With decades of expertise, we are committed to delivering high-quality, eco-friendly, and performance-driven chemical solutions to industries worldwide.</p>', NULL, 'about-us', 'About Us | GTZ India Pvt Ltd - Trusted Chemical Supplier', 'GTZ India Pvt Ltd, a trusted chemical supplier and manufacturer, provides high-quality solutions for metal finishing, textiles, leather, API chemicals worldwide', '<script type=\"application/ld+json\">\r\n{\r\n  \"@context\": \"https://schema.org/\",\r\n  \"@type\": \"ContactPage\",\r\n  \"accountablePerson\": {\r\n    \"@type\": \"Person\",\r\n    \"name\": \"Arun Kumar Sawalka\",\r\n    \"image\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n    \"url\": \"https://www.gtzworld.com/contact-us\",\r\n    \"jobTitle\": \"Chairman\"\r\n  }\r\n}\r\n</script>\r\n<script type=\"application/ld+json\">\r\n{\r\n  \"@context\": \"https://schema.org/\",\r\n  \"@type\": \"AboutPage\",\r\n  \"accountablePerson\": {\r\n    \"@type\": \"Person\",\r\n    \"name\": \"Arun Kumar Sawalka\",\r\n    \"image\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n    \"url\": \"https://www.gtzworld.com/about-us\",\r\n    \"jobTitle\": \"Chairman\"\r\n  }\r\n}\r\n</script>\r\n<script type=\"application/ld+json\">\r\n{\r\n  \"@context\": \"https://schema.org/\",\r\n  \"@type\": \"Organization\",\r\n  \"url\": \"https://www.gtzworld.com/\",\r\n  \"logo\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n  \"name\": \"GTZ india Pvt. Ltd.\",\r\n  \"image\": \"http://www.gtzworld.com/assets/frontend/img/inner-banners.jpg\",\r\n  \"email\": \"connect@gtzworld.com\",\r\n  \"