(5, 'Contact Us | GTZ India Pvt. Ltd.', 'contact-us', NULL, NULL, '<p>Get in Touch with Us</p>\r\n<p>Looking for high-quality specialty chemicals tailored to your industry needs? Our team is here to assist you!</p>', NULL, 'contact-us', 'Contact GTZ India Pvt Ltd | Get in Touch for Chemical Solutions', 'Need high-quality chemical solutions? Contact GTZ India Pvt Ltd today for expert guidance and industry-leading products. Call or email us for inquiries.', NULL, 'index, follow', 'Google-Organic', 'SEO', 'DM', '1', '1', '2024-08-09 12:11:23', '2025-02-16 06:45:58'),
(6, 'GTZ India Pvt Ltd  Gallery', 'gallery', NULL, NULL, '<h3 data-start=\"37\" data-end=\"89\"><strong data-start=\"41\" data-end=\"87\">A Glimpse into Our Innovation &amp; Excellence</strong></h3>\r\n<p>Explore the world of GTZ India Pvt Ltd through our gallery, showcasing our state-of-the-art manufacturing facilities, industry events, product innovations, and team milestones.</p>', NULL, 'gallery', 'GTZ India Gallery | Explore Our Innovations & Achievements', 'Browse the GTZ India Gallery to see our latest products, industry events, and innovations in chemical manufacturing. Explore our journey through visuals!', NULL, 'index, follow', 'Google_Organic', 'SEO', 'DM', '1', '1', '2024-10-01 11:54:45', '2025-02-16 07:01:36'),
(7, 'Join Our Team at GTZ India Pvt. Ltd.', 'career', NULL, NULL, '<p>At GTZ India Pvt Ltd, we believe that our greatest asset is our people. With over 85 years of industry leadership in specialty chemicals manufacturing and trading, we offer a dynamic and growth-oriented work environment where innovation, collaboration, and expertise thrive.</p>', NULL, 'career', 'Jobs & Career in GTZ India Pvt. Ltd.', 'Jobs & Career in GTZ India. Looking for an opportunity? Apply for a position in GTZ India Pvt. Ltd. Learn, earn & have fun.', 'career', 'index, follow', 'career', 'career', 'DM', '1', '1', '2024-10-01 11:57:28', '2025-02-16 06:56:13'),
(8, 'Thank You', 'thank-you', NULL, NULL, '<p>Thank You</p>', NULL, 'thank-you', 'Thank You', 'Thank You', NULL, 'index, follow', 'Google_Organic', 'SEO', 'DM', '1', '1', '2024-11-15 11:53:52', '2024-11-15 11:53:52'),
