(17, 'schema', '<script type=\"application/ld+json\">\r\n	{\r\n	  \"@context\": \"https://schema.org/\",\r\n	  \"@type\": \"Organization\",\r\n	  \"url\": \"https://www.gtzworld.com/\",\r\n	  \"logo\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n	  \"name\": \"GTZ India Pvt. Ltd.\",\r\n	  \"image\": \"https://www.gtzworld.com/assets/frontend/img/slider1.jpg\",\r\n	  \"email\": \"connect@gtzworld.com\",\r\n	  \"description\": \"GTZ India Pvt Ltd offers a wide range of industrial chemicals, including metal finishing, steel mill, textile, leather, and API chemicals. Contact us for high-performance chemical solutions.\",\r\n	  \"address\": \"9, Brabourne Road, Kolkata 700 001, West Bengal, India\",\r\n	  \"telephone\": \"+91 33 2242 9900\",\r\n	  \"brand\": {\r\n		\"@type\": \"Organization\",\r\n		\"name\": \"GTZ India Pvt. Ltd.\",\r\n		\"logo\": \"https://www.gtzworld.com/assets/frontend/img/logo.png\",\r\n		\"url\": \"https://www.gtzworld.com/\",\r\n		\"sameAs\": \"\",\r\n		\"location\": \"Kolkata\",\r\n		\"identifier\": \"\"\r\n	  },\r\n	  \"aggregateRating\": {\r\n		\"@type\": \"AggregateRating\",\r\n		\"ratingValue\": \"4.7\",\r\n		\"ratingCount\": \"129900\"\r\n	  },\r\n	  \"areaServed\": \"World\",\r\n	  \"founder\": {\r\n		\"@type\": \"Person\",\r\n		\"name\": \"Arun Kumar Sawalka\",\r\n		\"image\": \"https://media.licdn.com/dms/image/v2/C4E03AQEFbc3HxdS5yA/profile-displayphoto-shrink_400_400/profile-displayphoto-shrink_400_400/0/1628321557231?e=1745452800&v=beta&t=XVMGaYCThwhiC3RcO78cXQU6xWRUUerLwH7LjB7_IgE\",\r\n		\"url\": \"https://www.linkedin.com/in/rohan-sawalka-4b4b9b202/\",\r\n		\"jobTitle\": \"CEO\"\r\n	  }\r\n	}\r\n	</script>\r\n	<script type=\"application/ld+json\">\r\n	{\r\n	  \"@context\": \"https://schema.org/\",\r\n	  \"@type\": \"WebSite\",\r\n	  \"name\": \"GTZ India Pvt. Ltd.\",\r\n	  \"url\": \"https://www.gtzworld.com/\",\r\n	  \"aggregateRating\": {\r\n		\"@type\": \"AggregateRating\",\r\n		\"itemReviewed\": {\r\n		  \"@type\": \"Organization\",\r\n		  \"name\": \"GTZ India Pvt. Ltd.\"\r\n		},\r\n		\"ratingValue\": \"4.9\",\r\n		\"ratingCount\": \"232000\"\r\n	  }\r\n	}\r\n	</script>\r\n	\r\n	<script type=\"application/ld+json\">\r\n	{\r\n	  \"@context\": \"https://schema.org/\",\r\n	  \"@type\": \"FAQPage\",\r\n	  \"mainEntity\": [\r\n		{\r\n		  \"@type\": \"Question\",\r\n		  \"name\": \"What industries do GTZ India\'s chemicals serve?\",\r\n		  \"acceptedAnswer\": {\r\n			\"@type\": \"Answer\",\r\n			\"text\": \"GTZ India provides specialized chemical solutions for industries including metal finishing, steel mills, plywood/MDF finishing, textiles, leather processing, coatings, organic chemicals, and pharmaceuticals (APIs). Their products are designed for industrial applications like corrosion protection, electroplating, surface finishing, and chemical processing.\"\r\n		  }\r\n		},\r\n		{\r\n		  \"@type\": \"Question\",\r\n		  \"name\": \"How can I request a product quote from GTZ India?\",\r\n		  \"acceptedAnswer\": {\r\n			\"@type\": \"Answer\",\r\n			\"text\": \"Visitors can request a quote by filling out the Get Quote form on the website, available on product pages. You can also contact GTZ India directly via phone or email for detailed inquiries and bulk orders.\"\r\n		  }\r\n		},\r\n		{\r\n		  \"@type\": \"Question\",\r\n		  \"name\": \"Where are GTZ India\'s manufacturing and corporate offices located?\",\r\n		  \"acceptedAnswer\": {\r\n			\"@type\": \"Answer\",\r\n			\"text\": \"Head Office: 9, Brabourne Road, Kolkata, 700 001, West Bengal, India.\r\nManufacturing Site: Mouza: Khariberia, P.O.: Bishnupur, Dist. 24 Parganas (South), Pincode: 743 503, West Bengal, India.\"\r\n		  }\r\n		},\r\n		{\r\n		  \"@type\": \"Question\",\r\n		  \"name\": \"Does GTZ India provide customized chemical solutions?\",\r\n		  \"acceptedAnswer\": {\r\n			\"@type\": \"Answer\",\r\n			\"text\": \"Yes, GTZ India offers customized chemical formulations based on industry requirements. Clients can collaborate with their research and development team to develop specific solutions for surface treatment, metal plating, coatings, and more.\"\r\n		  }\r\n		}\r\n	  ]\r\n	}\r\n	</script>', '2025-02-28 17:19:27', '2025-03-02 15:54:16');
