INSERT INTO `vacancies` (`id`, `name`, `slug`, `description`, `department`, `division`, `location`, `type`, `experince`, `prefarence`, `salary`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Manager', 'manager', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; clear: both; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">Job description</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; clear: both; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">&bull; PHP developer with knowledge of SQL.<br style=\"box-sizing: border-box;\" />&bull; Participate in the full life-cycle development process from software definition, through design, development, test (Unit &amp; Integration), release, and maintenance<br style=\"box-sizing: border-box;\" />&bull; Having knowledge of any of the given web services like JSON, REST APIs/web services<br style=\"box-sizing: border-box;\" />&bull; Code management on the versioning control system, Git<br style=\"box-sizing: border-box;\" />&bull; Document the development process, architecture, and standard components</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; clear: both; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">Requirements</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 20px; clear: both; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">&bull; In-depth knowledge of object-oriented PHP<br style=\"box-sizing: border-box;\" />&bull; Must have previous experience in the development of high-end web applications in PHP, MYSQL/POSTGRESQL<br style=\"box-sizing: border-box;\" />&bull; Previously built applications/websites in MVC frameworks<br style=\"box-sizing: border-box;\" />&bull; Strong understanding of front-end technologies, such as JavaScript, HTML5, and CSS3<br style=\"box-sizing: border-box;\" />&bull; Strong knowledge of JavaScript and JavaScript frameworks, preferably jQuery<br style=\"box-sizing: border-box;\" />&bull; Proficient understanding of code versioning tools, such as Git<br style=\"box-sizing: border-box;\" />&bull; Familiarity with SQL databases and their declarative query languages<br style=\"box-sizing: border-box;\" />&bull; Strong knowledge of coding best practices, server deployment, and troubleshooting</p>', 'Sales', 'Steel Mill and Metal Finishing', 'Kolkata', 'Full Time', '10-12 Years', NULL, '5 LPA', '1', '2024-08-29 12:52:08', '2024-08-29 12:52:08'),
(2, 'Sr. Manager', 'senior-manager', '<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">Qualification</span><br style=\"box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\" /><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">B. Com, CA (Inter)</span><br style=\"box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\" /><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">15 years experience preferably in Industrial Organisations.</span></p>', 'Sales', '', 'Kolkata', 'Full Time', '10-12 Years', NULL, '5 LPA', '1', '2024-08-29 12:54:34', '2024-08-29 12:54:34'),
(4, 'Sr. Executive', 'sr-executive', '<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">Qualification</span><br style=\"box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\" /><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">B. Com</span><br style=\"box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\" /><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">Experience</span><br style=\"box-sizing: border-box; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\" /><span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">Minimum 4 to 5 years</span></p>', 'Sales', '', 'Kolkata', 'Full Time', '5-7 Years', NULL, '5 LPA', '1', '2024-08-29 12:55:57', '2024-08-29 12:55:57'),
