INSERT INTO `wp_aioseo_notifications` (`id`, `slug`, `addon`, `title`, `content`, `type`, `level`, `notification_id`, `notification_name`, `start`, `end`, `button1_label`, `button1_action`, `button2_label`, `button2_action`, `dismissed`, `new`, `created`, `updated`) VALUES
(1, '67668992abe87', NULL, 'Have you connected your site to Google Search Console?', 'All in One SEO can now verify whether your site is correctly verified with Google Search Console and that your sitemaps have been submitted correctly. Connect with Google Search Console now to ensure your content is being added to Google as soon as possible for increased rankings.', 'warning', '[\"all\"]', NULL, 'search-console-site-not-connected', '2024-12-21 09:25:38', NULL, 'Connect to Google Search Console', 'https://route#aioseo-settings&aioseo-scroll=google-search-console-settings&aioseo-highlight=google-search-console-settings:webmaster-tools?activetool=googleSearchConsole', NULL, NULL, 0, 0, '2024-12-21 09:25:38', '2024-12-21 09:25:38'),
(2, '6779507b7cc1a', NULL, 'Email Reports', 'Stay ahead in SEO with our new email digest! Get the latest tips, trends, and tools delivered right to your inbox, helping you optimize smarter and faster. Enable it today and never miss an update that can take your rankings to the next level.', 'info', '[\"all\"]', NULL, 'email-reports-enable-reminder', '2025-01-04 15:15:07', NULL, 'Enable Email Reports', 'https://route#aioseo-settings&aioseo-scroll=aioseo-email-summary-row&aioseo-highlight=aioseo-email-summary-row:advanced', 'All Good, I\'m already getting it', 'http://action#notification/email-reports-enable', 0, 0, '2025-01-04 15:15:07', '2025-01-04 15:15:07'),
(3, '67a223a2aa184', NULL, '[New] Smarter Keyword Rank Tracking &amp; WooCommerce SEO Made Easy!', '<p>We just released AIOSEO 4.7.8 and its loaded with some exciting updates!</p>\n\n<p>The top ones include:</p>\n\n<p> <strong>Smarter Keyword Rank Tracker</strong>: Our Keyword Rank Tracker just got some massive upgrades you dont want to miss. Now you can get related keywords, import keywords from GSC and more.</p>\n\n<p> <strong>Support for WooCommerce Product Attributes</strong>: Setting product attributes in WordPress just got way easier. Plus, you can also export product attributes!</p>\n\n<p>Update to AIOSEO 4.7.8 now and take your SEO to another level.</p>', 'success', '[\"4-x\",\"lite\"]', 1213, NULL, '2025-01-28 00:00:00', NULL, 'Learn More', 'https://aioseo.com/smarter-keyword-rank-tracking-woocommerce-seo-made-easy/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=478-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=478-v4-x-lite', 0, 0, '2025-02-04 14:26:42', '2025-04-11 04:45:22'),
(4, '67eb81e920d68', NULL, '[New] Supercharged Crawl Cleanup and Query Arg Monitoring! ', '<p>Is your WordPress site slowing down? Or are AI bots scraping your content? </p>\n\n<p><strong>AIOSEO 4.8.0 puts you in control with</strong>:<br> <strong>Supercharged Crawl Cleanup</strong>  Stop search engines from indexing unnecessary URLs.<br> <strong>Advanced Query Monitoring</strong>  Optimize UTM parameters automatically.<br> <strong>Bot Control</strong>  Block unauthorized AI crawlers.<br> <strong>Internal Search Optimization</strong>  Prevent spam &amp; boost performance.<br><br> Keep your site fast, secure, and SEO-friendly. Update now! </p>', 'success', '[\"4-x\",\"lite\"]', 1222, NULL, '2025-03-11 00:00:00', NULL, 'Learn More', 'https://aioseo.com/introducing-aioseo-4-8-0-advanced-crawl-features/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=480-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=480-v4-x-lite', 0, 1, '2025-04-01 06:04:25', '2025-04-11 04:45:22');
