(7, 1, '2024-12-21 09:47:53', '2024-12-21 09:47:53', '<h3 class=\"u-h4\">12.10Nonaqueous environments</h3>\r\n<div>\r\n\r\n<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about Organic solvents from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/organic-solvents\">Organic solvents</a>are used in paints, in<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about paint strippers from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/paint-stripper\">paint strippers</a>and as<span class=\"topic-highlight\">degreasing agents</span>, so the resistance of organic polymer-based composites to these materials should be discussed. Cross-linked<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about thermoset resins from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/thermoset-resin\">thermoset resins</a>or crystalline<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about thermoplastics from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/thermoplastics\">thermoplastics</a>do not dissolve in common organic solvents. However, the<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about amorphous regions from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/amorphous-region\">amorphous regions</a>of the thermoplastics and the cured<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about thermosets from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/thermoset-plastics\">thermosets</a>used as<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about composite matrices from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/matrix-composite\">composite matrices</a>will swell after contact. The solvent will tend to dissolve (i.e. diffuse) into the polymer in an analogous mechanism to<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about moisture diffusion from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/moisture-diffusion\">moisture diffusion</a>but at a higher rate. The degree of swelling will be maximised in contact fluids with a similar solubility parameter as the<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about polymer matrix from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/polymer-matrix\">polymer matrix</a>. The solubility parameters of the matrix and the solvent can be estimated using simple additive principles[45]. The concept of solubility parameters is simply described by Eqn(12.16):\r\n<div class=\"formula\"><span class=\"label\">(12.16)</span><span class=\"math\">solvent=polymer</span></div>\r\nwhere<em></em><sub>solvent</sub>and<em></em><sub>polymer</sub>are the solubility parameters.\r\n\r\n</div>\r\n<p id=\"B9780857095237000128-p0485\">The maximum<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about plasticisation from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/plasticisation\">plasticisation</a>of the matrix will occur under these conditions which will lead to a high potential to creep under off-axis loads. The residual stress state will also be significantly modified, as discussed in this chapter.</p>\r\n<p id=\"B9780857095237000128-p0490\">Schulte[46,47]has demonstrated how different organic solvents, such as<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about hydraulic fluid from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/hydraulic-fluid\">hydraulic fluid</a>encountered in the aerospace structures, lead to a reduction in the secant modulus of 45 glass fibre laminate under flexural fatigue and the number of cycles to failure. The matrix in this case was a polyether imide (PEI) which is plasticised by ingress of the fluid. A reduction in the matrix modulus means that the shear<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about strength from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/mechanical-strength\">strength</a>of the matrix will also be reduced with the consequence that the failure mechanism in<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about flexure from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/flexure\">flexure</a>will change from matrix-fracture to<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about delamination from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/delamination\">delamination</a>.<span id=\"B9780857095237000128-p363\"></span></p>\r\n<p id=\"B9780857095237000128-p0495\">Matrix swelling also contributes to the loss of durability in the 0 composite where plasticisation causes buckling in the compressive face of the coupon[46,47]. This occurs because in compression, the plasticised matrix is unable to support the reinforcement.</p>\r\n<p id=\"B9780857095237000128-p0500\">The reader should be reminded that PEI is an<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about amorphous polymer from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/amorphous-polymer\">amorphous polymer</a>and is much more susceptible to solvents than partially<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about crystalline polymers from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/crystalline-polymer\">crystalline polymers</a>such as<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about PEEK from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/engineering/polyetheretherketone\">PEEK</a>, which are used for<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about structural composites from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/materials-science/structural-composite-material\">structural composites</a>.</p>\r\n<p id=\"B9780857095237000128-p0505\">Weatherhead[48]and Jones[7]provide a survey of the durability of resins to a range of environments.</p>\r\n\r\n<h2 id=\"tp-snippet-chp-title-B9780080468846010253\" class=\"u-font-serif u-text-light u-h3\"><a class=\"anchor anchor-secondary\" href=\"https://www.sciencedirect.com/science/article/pii/B9780080468846010253\" data-aa-region=\"aa-tp-snippet-chp-title\" data-aa-name=\"Hepatic Toxicology\"><span class=\"anchor-text-container\"><span class=\"anchor-text\">Hepatic Toxicology</span></span></a></h2>\r\n<p class=\"u-font-sans text-s\">J.R.Roede, ...D.R.Petersen, in<a class=\"anchor anchor-primary\" href=\"https://www.sciencedirect.com/referencework/9780080468846/comprehensive-toxicology\" data-aa-region=\"aa-tp-snippet-bk-title\" data-aa-name=\"Comprehensive Toxicology\"><span class=\"anchor-text-container\"><span class=\"anchor-text\">Comprehensive Toxicology</span></span></a>, 2010</p>\r\n\r\n<section id=\"B9780080468846010253-s0050\">\r\n<h3 class=\"u-h4\">9.26.5.2Trichloroethylene</h3>\r\n<p id=\"B9780080468846010253-p0060\">Trichloroethylene (TCE) is a widely used solvent since the early 1900s and is a highly effective<span class=\"topic-highlight\">degreasing agent</span>in a variety of industrial settings. TCE has also been used as a dry cleaning solvent, an ingredient in printing inks and paints as well as a general anesthetic or analgesic. TCE is not believed to occur in nature; however, it has been found in both ground and<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about surface waters from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/surface-water\">surface waters</a>as disposal waste from manufacturing establishments. Whereas the use of TCE in the United States has declined since the 1970s, human exposure remains a concern (Bakke<em>et al.</em>2007).</p>\r\n<p id=\"B9780080468846010253-p0065\">Routes of exposure to TCE include common occupational exposures, such as inhalation and dermal absorption, and ingestion due to contaminated ground water (Bakke<em>et al.</em>2007). TCE is primarily metabolized by<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about CYP450 from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/cytochrome-p450\">CYP450</a>enzymes with<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about CYP2E1 from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/cyp2e1\">CYP2E1</a>being the primary isoform responsible for biotransformation of TCE. CYP2E1 metabolizes TCE into<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about trichloroacetaldehyde from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/chloral\">trichloroacetaldehyde</a>(chloral), which is the major reactive metabolite. Chloral is then further metabolized to trichloro- or<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about dichloroacetate from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/dichloroacetic-acid\">dichloroacetate</a>(Costa<em>et al.</em>1980; Elfarra<em>et al.</em>1998; Lash<em>et al.</em>2000).</p>\r\n<p id=\"B9780080468846010253-p0070\">Owing to the fact that the metabolism of TCE yields a reactive metabolite, chloral, binding of this metabolite to cellular macromolecules such as proteins can lead to the alteration of normal cellular function (Halmes<em>et al.</em>1996). For instance, binding of chloral to lysine residues of proteins could cause an alteration in or inhibition of that proteins normal function. In this context, TCE-derived metabolites have been implicated in TCE-induced liver cancer in mice (Elfarra<em>et al.</em>1998). Metabolism of TCE can also lead to oxidative stress and lipid peroxidation resulting in the production of other aldehydes such as<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about malondialdehyde from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/malonaldehyde\">malondialdehyde</a>(MDA) and 4-HNE. As outlined above, these newly generated aldehydes can then modify cellular proteins resulting in altered homeostasis and/or the generation of<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about haptens from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/hapten\">haptens</a>resulting in an immune response (Wang<em>et al.</em>2006).</p>\r\n\r\n<h2 id=\"tp-snippet-chp-title-B9780128125229000026\" class=\"u-font-serif u-text-light u-h3\"><a class=\"anchor anchor-secondary\" href=\"https://www.sciencedirect.com/science/article/pii/B9780128125229000026\" data-aa-region=\"aa-tp-snippet-chp-title\" data-aa-name=\"Advances in TCE Toxicology\"><span class=\"anchor-text-container\"><span class=\"anchor-text\">Advances in TCE Toxicology</span></span></a></h2>\r\n<p class=\"u-font-sans text-s\">YanJiang, ...TaoChen, in<a class=\"anchor anchor-primary\" href=\"https://www.sciencedirect.com/bookseries/advances-in-molecular-toxicology\" data-aa-region=\"aa-tp-snippet-bk-title\" data-aa-name=\"Advances in Molecular Toxicology\"><span class=\"anchor-text-container\"><span class=\"anchor-text\">Advances in Molecular Toxicology</span></span></a>, 2017</p>\r\n\r\n<section id=\"B9780128125229000026-s0010\">\r\n<h3 class=\"u-h4\">1Introduction</h3>\r\n<p id=\"B9780128125229000026-p0010\">Trichloroethylene (TCE), a<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about volatile organic from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/volatile-organics\">volatile organic</a>solvent, is widely used in industry as a metal-<span class=\"topic-highlight\">degreasing agent</span>and in the production of chlorinated chemical compounds. As a result of the widespread use, TCE is a common contaminant in the atmosphere,<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about ground water from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/ground-water\">ground water</a>, drinking water, and food[1]. Occupational exposure to TCE occurs through inhalation and dermal contact, and the general public may be exposed to TCE through inhalation and ingestion of contaminated water and food. For all the three routes of exposures (ingestion, inhalation, and dermal contact), the metabolic pathways of TCE are similar[2]. TCE has been classified as carcinogenic to humans (Group 1)[3,4]. TCE also poses noncancer risks to the central nervous system, kidney, liver, immune system, reproductive system, and development of the fetus. This review will focus on the<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about carcinogenicity from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/carcinogenicity\">carcinogenicity</a>(kidney and liver cancer), the<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about immunotoxicity from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/immunotoxicity\">immunotoxicity</a>, and the cardiac<a class=\"topic-link\" tabindex=\"0\" title=\"Learn more about developmental toxicity from ScienceDirect\'s AI-generated Topic Pages\" href=\"https://www.sciencedirect.com/topics/pharmacology-toxicology-and-pharmaceutical-science/developmental-toxicity\">developmental toxicity</a>of TCE.</p>\r\n\r\n</section></section>', 'The response of aerospace composites to temperature and humidity', '12.10 Nonaqueous environments Organic solvents are used in paints, in paint strippers and as degreasing agents, so the resistance of organic polymer-based composites to these materials should be discussed. Cross-linked thermoset resins or crystalline thermoplastics do not dissolve in common organic solvents.', 'publish', 'open', 'open', '', 'the-response-of-aerospace-composites-to-temperature-and-humidity', '', '', '2024-12-21 09:48:44', '2024-12-21 09:48:44', '', 0, 'https://gtzworld.com/blog/?p=7', 0, 'post', '', 0),
